import React from 'react';
import './stylesheet.css';

function myFunction() {
    const x = document.getElementById("myDIV");
    if (x.innerHTML === "Hello") {
        x.innerHTML = "Swapped text!";
    } else {
        x.innerHTML = "Hello";
    }
}

export default myFunction;
